import { BrowserRouter, Routes, Route } from "react-router-dom";
import Home from "./components/Home";
import AppBar from "./components/AppBar";
function App() {
  return (
    <BrowserRouter>
    <AppBar></AppBar>
    <Routes>
      <Route path="/" element={<Home></Home>}></Route>
    </Routes>
    </BrowserRouter>
  );
}

export default App;
